import React from "react";

const Header = () => {
  return (
    <div className="header">
      <span>Spanish</span>
      <span>
        <input type="search" height="10px"></input>
      </span>
      <span>
        <button>
          <img
            src="https://www.freepnglogos.com/uploads/search-png/search-very-basic-icon-ios-iconset-icons-7.png"
            width="20px"
          ></img>
        </button>
      </span>
    </div>
  );
};

export default Header;
